import React from "react";
import styled from "styled-components";

const SearchDivStyle = styled.div`
  display: flex;
  & input {
    color: #fff;
    background-color: #213743;
    border-radius: 3px;
    height: 25px;
    width: 400px;
    outline-style: none;
    box-shadow: none;
    border-color: transparent;
  }
`;

const SearchBar = () => {
  return (
    <SearchDivStyle>
      <input type="text" />
    </SearchDivStyle>
  );
};

export default SearchBar;
